import styles from "./Header.module.css";

const links = [
  {
    id: 1,
    item: "Home",
    link: "#home",
  },
  {
    id: 2,
    item: "Services",
    link: "#services",
  },
  {
    id: 2,
    item: "About Us",
    link: "#about",
  },
  {
    id: 4,
    item: "Careers",
    link: "#careers",
  },
  {
    id: 5,
    item: "Contact Us",
    link: "#contact",
  },
];

export default function Header() {
  return (
    <header className={styles.header}>
      <div className={styles.logo_div}>
        <img src="logo.png" alt="simba_talents_logo" />
      </div>
      <div className={styles.links_div}>
        <Links />
      </div>
    </header>
  );
}

function Links() {
  return (
    <ul className={styles.links}>
      {links.map((el) => (
        <Link key={el.id} item={el.item} />
      ))}
    </ul>
  );
}

function Link({ item }) {
  return <li>{item}</li>;
}
